        <form>
            <Field name={`name`} label={'NAME'} component={FormInput}/>
            <Field name={`price`} label={'PRICE'} component={FormInput}/>
            <Field name={`category`} label={'CATEGORY'} component={FormInput}/>
            <Field name={`name`} label={'NAME'} component={FormInput}/>
            <Field name={`name`} label={'NAME'} component={FormInput}/>
